inline double predict(const std::vector<double>& features) {
    double sum = INTERCEPT;
    const double* coef = getCoefficients();
    const double* mean = getScalerMean();
    const double* scale = getScalerScale();
    for (int i = 0; i < N_FEATURES; ++i) {
        double scaled = (features[i] - mean[i]) / (scale[i] + 1e-10);
        sum += coef[i] * scaled;
    }
    return sum;
}

